module.exports = function(helper) {
  var binaryToPulse, protocolInfo, pulsesToBinaryMapping;
  pulsesToBinaryMapping = {
    '01': '1',
    '00': '0',
    '02': ''
  };
  binaryToPulse = {
    '0': '00',
    '1': '01'
  };
  return protocolInfo = {
    name: 'switch22',
    type: 'switch',
    values: {
      unitCode: {
        type: "string"
      },
      state: {
        type: "string"
      }
    },
    brands: ["LightwaveRFMood"],
    pulseLengths: [276, 1356, 10784],
    pulseCount: 144,
    decodePulses: function(pulses) {
      var binary, result, state, unitCode;
      binary = helper.map(pulses, pulsesToBinaryMapping);
      state = binary.substring(0, 29);
      unitCode = binary.substring(30);
      return result = {
        unitCode: unitCode,
        state: state
      };
    }
  };
};
